def add_countries_and_zones(apps, _):
    WorldZone = apps.get_model("main", "WorldZone")
    Country = apps.get_model("main", "Country")
    for code, name in ZONES:
        WorldZone.objects.get_or_create(code=code, defaults={"name": name})

    for country in COUNTRIES:
        zone = None
        if country["zone"]:
            try:
                zone = WorldZone.objects.get(code=country["zone"])
            except WorldZone.DoesNotExist:
                print("does not exist: ", country["zone"])
                raise WorldZone.DoesNotExist()

        Country.objects.get_or_create(
            code=country["code"],
            defaults={
                "zone": zone,
                "latitude": country["lat"],
                "longitude": country["lon"],
                "name": country["country"],
            },
        )


def do_nothing(apps, _):
    pass


